Journey.create(
  scenario: "The few days have been going well. That is until crew member contracted dysentery - Space Dysentery - and it’s THE WORST. crew member has been quarantined. You may find a cure on your journey, you may not. Do you:",
  week_number: 1,
  user_id: 1
)

Outcome.create(
  choice_prompt: "Send the crew member out the airlock. They always chewed with their mouth open.",
  consequence: "crew member has been sent on the airlock. crew member was secretly in love with the other crew member and joins them in space. You lose 2 crew.",
  crew_modifier: -2,
  choice: 1,
  journey_id: 1,
  week_number: 1
)

Outcome.create(
  choice_prompt: "Keep them on board and hope to find a cure in the upcoming days. The crew member is recently married and has a 3 month old named Arlo and a yorkie named Jax on Argon after all.",
  consequence: "You’ve spared the crew member. You are a good person. Everyone thinks so … except Space dysentery. The disease spreads and 3 crew members die.",
  crew_modifier: -3,
  choice: 1,
  journey_id: 1,
  week_number: 1
)

Journey.create(
  scenario: "You get a distress signal from a nearby space station. You decide to check it out. It is abandoned except for one lone crew member. He seems a bit strange and rightfully so. He says he’s been alone for 3 months. Do you:",
  week_number: 2,
  user_id: 1
)

Outcome.create(
  choice_prompt: "Bring Herm on board. You could use another hand.",
  consequence: "Herm appreciates that you brought him on board - so appreciative that he gives you two gifts - the heads of two of your crew members. You loose two crew members and you space Herm.",
  crew_modifier: -2,
  choice: 1,
  journey_id: 1,
  week_number: 2
)

Outcome.create(
  choice_prompt: "Leave him behind. There’s a reason he’s been left behind.",
  consequence: "You leave him behind. Are you a bad person? Let’s let the Fates decide...",
  crew_modifier: 0,
  choice: 2,
  journey_id: 1,
  week_number: 2
)


Journey.create(
  scenario: "You get a hail from another ship and it is not normal. Congrats, you’ve made first contact, but there’s good news and there’s bad news. The good news is they won’t destroy your ship. The bad news - you must hand over 1 of your crew members to not be destroyed. Do you:",
  week_number: 3,
  user_id: 1
)

Outcome.create(
  choice_prompt: "Draw straws. Send over 1 to save the many.",
  consequence: "It was a tough decision but you send over a crew member. Some of your crew are giving you serious “judgy” eyes.",
  crew_modifier: -1,
  choice: 1,
  journey_id: 1,
  week_number: 3
)
Outcome.create(
  choice_prompt: "Fight to the death, Three Musketeers style - 'All for one and one for all.'",
  consequence: "You are SO close to winning the battle, then the aliens decide to stop playing with you and explode all of your hearts using only the power of their minds. Your ship is now just another piece of space dust.",
  crew_modifier: -100,
  choice: 2,
  journey_id: 1,
  week_number: 3
)

Journey.create(
  scenario: "Oh no! A random crew member named crew member..hm, fell down the well...the engine well…how unfortunate... It looks like it might have been an accident. It also looks like it might not have been. It also also looks like there may be time to save them, or not. I’m not the one making the decisions here. Do you:",
  week_number: 4,
  user_id: 1
)

Outcome.create(
  choice_prompt: "Save crew member and be the hero?",
  consequence: "You rappel your way down the engine well! How heroic! You get to crew member’s lifeless body and discover their body is displaying symptoms of SPACE CHOLERA. Oh dear... Not only is SPACE CHOLERA highly contagious it’s super fast acting. You die, crew member is dead, your entire spaceship is going to die. You lose everyone on your spaceship.",
  crew_modifier: -7,
  choice: 1,
  journey_id: 1,
  week_number: 4
)
Outcome.create(
  choice_prompt: "Nah.",
  consequence: "You start walking away from crew member when you catch a familiar and very distinct smell...the burning flesh of someone with SPACE CHOLERA. WOW! The engine incinerated crew member’s body and with it the threat of SPACE CHOLERA to your ship. Your apathy towards human wellbeing has paid off this time! Nice, instead of everyone dying of SPACE CHOLERA only crew member dies. You lose 1 crew member.",
  crew_modifier: -1,
  choice: 2,
  journey_id: 1,
  week_number: 4
)

Journey.create(
  scenario: "You reach a river. I mean you approach Argon’s asteroid belt. Do you: ",
  week_number: 5,
  user_id: 1
)

Outcome.create(
  choice_prompt: "Ford, I mean do you attempt to cross through the asteroid belt directly.",
  consequence: "Your wagon tips o...ver…while floating you lose: 1 oxen, 3 wagon wheels...I mean your ship gets pummeled with asteroids. Everyone dies. You lose.",
  crew_modifier: -7,
  choice: 1,
  journey_id: 1,
  week_number: 5
)
Outcome.create(
  choice_prompt: "Or do you go around?",
  consequence: "You decide to take the longer but definitely safer, smarter and 100% assured way around. Definitely the better choice. For sure. Without a doubt. You make a ton of friends along the way and everyone is having a great time. You gain 2000 crew members.",
  crew_modifier: 2000,
  choice: 2,
  journey_id: 1,
  week_number: 5
)

